import React from "react";

function Product({ stock }) {
  return (
    <div>
      <img
        className="img"
        src={stock.items.images}
        alt={stock.items.item_name}
      />
      <h4>{stock.items.item_name}</h4>
      <p>{stock.items.description}</p>
      <div>${stock.items.price}</div>
    </div>
  );
}
export default Product;
